import Box from "@mui/material/Box";
import Button from '@mui/material/Button'

function LoginDiv() {
    return (
      <Box
            display="flex"
            justifyContent="center"
            alignItems="center"
      >
            <Button variant="outlined" size="large">Login</Button>
      </Box>
    );
}

export default LoginDiv;
